import AppLayout from '../components/AppLayout'

const Profile = () => {
  return (
    <>
      <Head>
        <meta charSet="utf-8" />
        <title>NodeBird</title>
      </Head>
      <AppLayout>내 프로필</AppLayout>
    </>
  )
}

export default Profile
